export function stereoProjectStars(size, lng, lat, time) {
    var Ti = StarJs.Time;
    if (typeof time === 'undefined') {
        time = +new Date();
    } else if (typeof time !== 'number') {
        time = +time;
    }
    
    var mjd = Ti.time2mjd(time);
    var gms_t = Ti.gmst(mjd);

    /** @const */
    var DEG2RAD = StarJs.Math.DEG2RAD;
    lng *= DEG2RAD;
    lat *= DEG2RAD;

    lng += gms_t;

    return stereographicProjectStars(lng, lat, Math.floor(size/2));
}
